import { motion, AnimatePresence } from 'framer-motion';
import styled from '@emotion/styled';
import { Link, useNavigate } from 'react-router-dom';
import { useState, useEffect } from 'react';

// ... existing styled components ...

// Move photographerWorks to a separate file
export const photographerWorks = {
  "Emma Thompson": [
    {
      id: "w1",
      title: "Beachside Ceremony",
      image: "https://images.unsplash.com/photo-1519741497674-611481863552",
      description: "Intimate beach wedding ceremony at sunset"
    },
    {
      id: "w2",
      title: "Garden Reception",
      image: "https://images.unsplash.com/photo-1519225421980-715cb0215aed",
      description: "Elegant outdoor wedding reception"
    },
    {
      id: "w3",
      title: "First Dance",
      image: "https://images.unsplash.com/photo-1583939003579-730e3918a45a",
      description: "Capturing the magical first dance moment"
    }
  ],
  "David Chen": [
    {
      id: "n1",
      title: "Mountain Dawn",
      image: "https://images.unsplash.com/photo-1506905925346-21bda4d32df4",
      description: "Sunrise over the mountain peaks"
    },
    // ... other David's works
  ]
};

// Add featuredWorks data
const featuredWorks = [
  {
    id: 1,
    title: "Urban Landscapes",
    description: "Modern architectural photography series",
    category: "Architecture",
    photographer: "Sofia Garcia",
    location: "Downtown Manhattan",
    date: "August 15, 2023",
    image: "https://images.unsplash.com/photo-1449157291145-7efd050a4d0e"
  },
  {
    id: 2,
    title: "Mountain Serenity",
    description: "Sunrise capture at Yosemite peaks",
    category: "Nature",
    photographer: "David Chen",
    location: "Yosemite National Park",
    date: "September 3, 2023",
    image: "https://images.unsplash.com/photo-1506905925346-21bda4d32df4"
  },
  {
    id: 3,
    title: "Tech Innovation Summit",
    description: "Annual technology conference highlights",
    category: "Event",
    photographer: "Marcus Williams",
    location: "Silicon Valley Convention Center",
    date: "October 12, 2023",
    image: "https://images.unsplash.com/photo-1511578314322-379afb476865"
  },
  {
    id: 4,
    title: "Urban Portrait Series",
    description: "Contemporary portrait session",
    category: "Portrait",
    photographer: "Sofia Garcia",
    location: "Downtown Art District",
    date: "July 28, 2023",
    image: "https://images.unsplash.com/photo-1534528741775-53994a69daeb"
  },
  {
    id: 5,
    title: "Alpine Adventure",
    description: "Dawn expedition capture",
    category: "Nature",
    photographer: "James Morrison",
    location: "Swiss Alps",
    date: "August 5, 2023",
    image: "https://images.unsplash.com/photo-1464822759023-fed622ff2c3b"
  },
  {
    id: 6,
    title: "Haute Couture",
    description: "Fashion Week editorial",
    category: "Fashion",
    photographer: "Isabella Laurent",
    location: "Paris Fashion Week",
    date: "September 30, 2023",
    image: "https://images.unsplash.com/photo-1509631179647-0177331693ae"
  }
];

function Home({ isDark }) {
  const navigate = useNavigate();
  const [currentReview, setCurrentReview] = useState(0);
  const [currentPage, setCurrentPage] = useState(0);
  const itemsPerPage = 3;
  const pageCount = Math.ceil(featuredWorks.length / itemsPerPage);

  // ... existing page navigation and useEffect ...

  return (
    <>
      {/* ... existing HeroSection and FeaturedWorks ... */}

      <TeamSection isDark={isDark}>
        <h2>Meet Our Team</h2>
        <TeamGrid>
          <AnimatePresence>
            {teamMembers.map((member) => (
              <TeamMemberCard
                key={member.id}
                isDark={isDark}
                initial={{ opacity: 0, y: 20 }}
                animate={{ opacity: 1, y: 0 }}
                whileHover={{ y: -10 }}
                transition={{ duration: 0.3 }}
                onClick={() => navigate(`/photographer/${encodeURIComponent(member.name)}`)}
                style={{ cursor: 'pointer' }}
              >
                <img src={member.image} alt={member.name} />
                <h3>{member.name}</h3>
                <p className="specialty">{member.specialty}</p>
                <p className="achievements">{member.achievements}</p>
              </TeamMemberCard>
            ))}
          </AnimatePresence>
        </TeamGrid>
      </TeamSection>

      {/* ... existing StatsSection ... */}
    </>
  );
}

export default Home;
